import React from 'react';
import Sidebar from './Sidebar'; // Import Sidebar if not included in App

function About() {
  return (
    <div className="container">
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className="content">
        <h2 style={{ textAlign: 'center', marginLeft: '180px' }}>Now you can create your account, please visit the account section</h2>
        <p style={{ textAlign: 'center', marginLeft: '180px' }}>Welcome to the Marketing Insights section. Steps to create an account.</p>
      </div>
    </div>
  );
}

export default About;
